import React from 'react'
import Button from './button'
import styled from 'styled-components'

const Inner = styled.div`
  align-items: center;
  display: flex;
`

const Container = styled.div`
  display: flex;
  flex-direction: column;
`

const Options = () => {
  return (
    <Container>
      <p>Prueba encontrada #1:</p>
      <Inner>
        <Button left />
        <p>Sin prueba</p>
        <Button />
      </Inner>
    </Container>
  )
}

export default Options
